import React, { useEffect } from 'react';


const Testing = () => {
    useEffect(() => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';

        return () => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';
        };
    }, []);

    return (
        <div className="content">
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%', width: '100%', color: 'white' }}>
                <h1>Testing</h1>
            </div>
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%', width: '100%', color: 'white', gap: '10rem' }}>
                <ul style={{ display: 'flex', listStyleType: 'none', padding: 0 , gap: '10rem' }}>
                    <li>Elemento 1</li>
                    <li>Elemento 2</li>
                    <li>Elemento 3</li>
                </ul>
            </div>
        </div>
    );
    };

export default Testing;
